import React from "react";
import Card from "./Cards";
import Sdata from "./Sdata"

const Netflix = () => {
    return (<Card key={Sdata[0].title} 
        imgsrc={Sdata[0].imgsrc} 
        title={Sdata[0].title} 
        sname={Sdata[0].sname} 
        link={Sdata[0].link} />
    );
}

export default Netflix;
